<style>
body {
    background-color: #181818;
}

#screen {
    background-color: #000000;
    position: absolute;
    top: 0px;
    bottom: 0px;
    left: 0px;
    right: 0px;
    width: 800px;
    height: 600px;
    margin: auto auto;
    overflow: hidden;
}

#msg {
    background-color: #000000;
    color: #ffffff;
    border: 2px solid #ff0000;
    padding: 0.2em 1em;
    position: absolute;
    left: 0px;
    right: 0px;
    text-align: center;
    margin: 0px auto;
    opacity: 0.7;
    z-index: 200;
    
    -moz-animation: msg_track 10.00s linear 0.00s infinite;
    -webkit-animation: msg_track 10.00s linear 0.00s infinite;
}

@-moz-keyframes msg_track {
  0%   { visibility: hidden; }
  100% { visibility: hidden; }
}

@-webkit-keyframes msg_track {
  0%   { visibility: hidden; }
  100% { visibility: hidden; }
}
</style>
